  const columns = [
    {
      title: "번호",
      dataIndex: "id",
    },
    {
      title: "제목",
      dataIndex: "title",
    },
    { titile: "작성자", dataIndex: "autor" },
    { title: "작성일", dataIndex: "createdAt" },
